response.about:
Родился в Пскове, но живу в Эстонии, а именно в Таллинне (с 3х лет). Закончил основную школу, гимназию, музыкальную школу. Сейчас учусь в университете и работаю (об этом указано выше).

Языки:
- русский - родной язык;
- эстонский - практически свободно;
- английский - практически свободно;
- немецкий - средний уровень;
- латинский - начальный уровень.

Люблю общаться, иногда и развлекаться (но в меру) не во зло работе и учебе.
Из вредных привычек:
- не курю (бросил);
- не пью (бросил);
- наркотики не потребляю.

Всегда рад интересным и коммуникабельным людям.
Все остальное узнаете потом...:)
